import styled from "styled-components/native";

export const Container = styled.View`
  margin: 35px auto;
`;

export const Image = styled.Image`
  width: 100px;
  height: 100px;
  align-self: center;
`;
export const UserName = styled.Text`
  font-weight: bold;
  font-size: 22px;
`;
export const Name = styled.Text``;
export const Link = styled.Text``;
